  casts aboard NOAA LAUNCHES (RAINIER) as part of project OPR-O333-RA-15 in the Coastal
  Waters of SE Alaska from 2015-05-04 to 2015-05-25 (NCEI Accession 0130936)\",\n\t\"tracking_summary\":
